import React from 'react';
import ReactDOM from 'react-dom';
import Header from './components/Header';
import Gallery from './components/Gallery';

const PhotoApp = () => (
    <Container fluid={true}>
        <Header />
        <Gallery />
    </Container>
);

export default PhotoApp;
